import React from "react";
import { useLocation } from "react-router-dom";

const ModeChoice = () => {
  const location = useLocation();
  const { distance } = location.state.distance
//   console.log(location.state.distance); 

let mode;
  if (distance === "<5km") {
    mode = "Walk / Bicycle";
  } else if (distance === ">5km") {
    mode = "Metro";
  }

  return (
    <div>
      <h1>Mode of Transportation: {mode}</h1>
    </div>
  );
};

export default ModeChoice;
